    public function getSourceContext()
    {
        return new Source("{% extends 'base_admin.html.twig' %}

{% block title %}Se connecter{% endblock %}

{% block body %}

<div class=\"container mt-4\">

    <form action=\"{{ path('login') }}\" method=\"post\">
        {% if error %}
            <div class=\"alert alert-danger\">{{ error.messageKey|trans(error.messageData, 'security') }}</div>
        {% endif %}

        <h1 class=\"h3 mb-3 font-weight-normal\">Connectez vous</h1>

        <div class=\"form-group\">
        <label for=\"username\" class=\"sr-only\">Nom utilisateur</label>
        <input type=\"text\" value=\"{{ last_username }}\" name=\"_username\" id=\"username\" class=\"form-control\" placeholder=\"Nom d'utilisateur\" required autofocus>
        </div>

        <div class=\"form-group\">
        <label for=\"password\">Mot de passe</label>
        <input type=\"password\" id=\"password\" name=\"_password\" class=\"form-control\" placeholder=\"Mot de passe\" required>
        </div>



        <button class=\"btn btn-lg btn-primary\" type=\"submit\">
            Connectez vous
        </button>

    </form>
</div>
{% endblock %}


", "security/login.html.twig", "/var/www/MonAgenceImmo/templates/security/login.html.twig");
